import {Route, Switch} from 'react-router-dom'

import Nav from './Nav';
import Home from './Home'
import Footer from './Footer'

class App extends Component {
  render() {
    return (
      <div className="App">
      <Nav />
      <Switch>
     // <Route path='/home' exact Component={Home}/>

      </Switch>
      <Footer />
      </div>
    );
  }
}

export default App;
